css:
@-moz-document domain(www.systemcheats.net) {

html {
    background: #000000 none;
}

.body_wrapper {
    border: 0px solid #000000;
    border-top: none;
    border-bottom: none;
}
.body_wrapper {
    padding: 0px 10px 0px 10px;
    background: rgb(150, 150, 150) none;
    -moz-border-radius: 5px;
    -webkit-border-radius: 5px;
    border-radius: 0px;
}

tbody {
    width: auto;
    min-width: 1200px;
    margin: 0px 35px 0px 35px;
    font-size: 13px;
    color: #000000;
    line-height: 1.230;
}

body a {
    color: rgb(0,0,0);
    text-decoration: none;
}

body {
    width: auto;
    min-width: 1200px;
    margin: 0px 35px 0px 35px;
    font-size: 13px;
    color: #ffffff;
    line-height: 1.230;
}

.footer_time {
    color: #000000;
    font: normal 11px Tahoma,Calibri,Verdana,Geneva,sans-serif;
    padding-top: 10px;
    text-align: left;
}

.footer_copyright, .footer_morecopyright {
    padding-bottom: 5px;
    color: #000000;
    font: normal 11px Tahoma,Calibri,Verdana,Geneva,sans-serif;
    margin-top: 10px;
    text-align: left;
    display: block;
}
}
